import {
  Box,
  Button,
  CssBaseline,
  FormControl,
  Grid,
  InputLabel,
  makeStyles,
  MuiThemeProvider,
  Paper,
  Select,
  TextField,
  Typography,
  withStyles,
} from "@material-ui/core";
import React, { useState } from "react";
import { App_bar } from "./App_Bar";
import pic from "./images/tell_us.png";
import { MenuItem } from "@material-ui/core";

import { purple } from "@material-ui/core/colors";

const LoginQue = (isDarkTheme) => {
  return (
    <Box bgcolor="background.default">
      {App_bar(isDarkTheme)}
      <Grid container justifyContent="center" alignItems="center">
        <Grid item md={4}>
          {BaseCom(isDarkTheme)}
        </Grid>
      </Grid>
    </Box>
  );
};

const ColorButton = withStyles((t) => ({
  root: {
    color: t.palette.getContrastText(purple[500]),
    backgroundColor: purple[500],
    "&:hover": {
      backgroundColor: purple[700],
    },
  },
}))(Button);

export default LoginQue;

export const BaseCom = (isDarkTheme) => {
  const useStyles = makeStyles(() => ({
    root: {
      "& > *": {
        width: "100%",
      },
    },

    paperRoot: {
      backgroundColor: isDarkTheme ? "#232323" : "#FFFFFFF",
      padding: "40px 48px 40px 46px",
      minWidth: "400px",
      color: isDarkTheme ? "#FFFFFF" : "#121212",
    },
    formControl: {
      width: "100%",
    },
  }));
  const classes = useStyles();
  const handleChange = (event) => {
    const name = event.target.name;
    setState({
      ...state,
      [name]: event.target.value,
    });
  };

  const [state, setState] = React.useState({
    age: "",
    name: "hai",
  });

  return (
    <Paper className={classes.paperRoot} elevation={10}>
      <Grid
        container
        direction="column"
        justifyContent="center"
        alignItems="stretch"
        spacing={2}
      >
        <Grid item align="center">
          <Box>
            <img alt="img" src={pic}></img>
          </Box>
        </Grid>
        <Grid item>
          <Typography align="center" variant="h2">
            Tell us about yourself!
          </Typography>
        </Grid>
        <Grid item>
          <Typography align="center">
            We want to tailor your experience.
          </Typography>
        </Grid>
        <Grid item>
          <TextField variant='outlined' id="select" label="Age" value="20" select fullWidth>
            <MenuItem value="10">Ten</MenuItem>
            <MenuItem value="20">Twenty</MenuItem>
          </TextField>
        </Grid>
       {/*  <Grid item>
          <TextField variant='outlined' id="select" label="Age" value="20" select fullWidth>
            <MenuItem value="10">Ten</MenuItem>
            <MenuItem value="20">Twenty</MenuItem>
          </TextField>
        </Grid>
        <Grid item>
          <TextField variant='outlined' id="select" label="Age" value="20" select fullWidth>
            <MenuItem value="10">Ten</MenuItem>
            <MenuItem value="20">Twenty</MenuItem>
          </TextField>
        </Grid> */}
        <Grid item>
          <Box mt={2}>
            <Button variant="contained" fullWidth>
              Save
            </Button>
          </Box>
        </Grid>
        <Grid item>
          <Box mt={2}>
            <Button variant="text" color="#fafafa" fullWidth>
              Skip for now
            </Button>
          </Box>
        </Grid>
      </Grid>
    </Paper>
  );
};
